explanationOfDynamicParameters=[[[\!\!\!\u0162\u0125\u0113 '\u016E\u015F\u0113 \u010E\u0177\u014B\u0105\u0271\u012F\u010B \u01A4\u0105\u0157\u0105\u0271\u0113\u0163\u0113\u0157\u015F' \u010B\u0125\u0113\u010B\u0137\u0183\u014F\u03C7 \u018C\u0113\u0163\u0113\u0157\u0271\u012F\u014B\u0113\u015F \u0125\u014F\u0175 \u015F\u012F\u014B\u011F\u013A\u0113 \u028B\u0105\u013A\u0171\u0113 \u0192\u012F\u013A\u0163\u0113\u0157\u015F \u0105\u014B\u018C \u03C1\u0105\u0157\u0105\u0271\u0113\u0163\u0113\u0157\u015F \u014F\u0192 \u0163\u0125\u0113 \u0105\u03C1\u03C1\u013A\u012F\u010B\u0105\u0163\u012F\u014F\u014B \u010B\u014F\u014B\u0163\u0113\u03C7\u0163 \u0105\u0157\u0113 \u0125\u0105\u014B\u018C\u0113\u018C \u014F\u028B\u0113\u0157 \u0163\u014F \u0163\u0125\u0113 \u014B\u0105\u028B\u012F\u011F\u0105\u0163\u012F\u014F\u014B \u0163\u0105\u0157\u011F\u0113\u0163. \u0162\u0125\u0113 \u0105\u03C1\u03C1\u013A\u012F\u010B\u0105\u0163\u012F\u014F\u014B \u010B\u014F\u014B\u0163\u0113\u03C7\u0163 \u010B\u014F\u014B\u0163\u0105\u012F\u014B\u015F \u0105\u013A\u013A \u0192\u012F\u013A\u0163\u0113\u0157 \u0105\u014B\u018C \u03C1\u0105\u0157\u0105\u0271\u0113\u0163\u0113\u0157 \u028B\u0105\u013A\u0171\u0113\u015F \u010B\u014F\u0271\u012F\u014B\u011F \u0192\u0157\u014F\u0271 \u011F\u013A\u014F\u0183\u0105\u013A \u0192\u012F\u013A\u0163\u0113\u0157\u015F \u015F\u0113\u0163 \u012F\u014B \u0163\u0125\u0113 \u0192\u012F\u013A\u0163\u0113\u0157 \u0183\u0105\u0157, \u015F\u0113\u013A\u0113\u010B\u0163\u012F\u014F\u014B\u015F \u012F\u014B \u0105\u014B\u0105\u013A\u0177\u015F\u012F\u015F \u015F\u0163\u0113\u03C1\u015F, \u0105\u014B\u018C \u0163\u0125\u0113 \u010B\u014F\u014B\u0163\u0113\u03C7\u0163 \u014F\u0192 \u0105\u014B\u014F\u0163\u0125\u0113\u0157 \u0105\u03C1\u03C1\u013A\u012F\u010B\u0105\u0163\u012F\u014F\u014B \u0192\u0157\u014F\u0271 \u0175\u0125\u012F\u010B\u0125 \u0163\u0125\u0113 \u0100\u01A4\u0191-\u0183\u0105\u015F\u0113\u018C \u0105\u03C1\u03C1\u013A\u012F\u010B\u0105\u0163\u012F\u014F\u014B \u0125\u0105\u015F \u0183\u0113\u0113\u014B \u013A\u0105\u0171\u014B\u010B\u0125\u0113\u018C.\n\n\u0181\u0177 \u018C\u0113\u0192\u0105\u0171\u013A\u0163, \u0163\u0125\u0113 \u010B\u0125\u0113\u010B\u0137\u0183\u014F\u03C7 \u012F\u015F \u014B\u014F\u0163 \u015F\u0113\u013A\u0113\u010B\u0163\u0113\u018C. \u012C\u014B \u0163\u0125\u012F\u015F \u010B\u0105\u015F\u0113, \u0163\u0125\u0113 \u0105\u03C1\u03C1\u013A\u012F\u010B\u0105\u0163\u012F\u014F\u014B \u010B\u014F\u014B\u0163\u0113\u03C7\u0163 \u012F\u015F \u0125\u0105\u014B\u018C\u0113\u018C \u014F\u028B\u0113\u0157 \u0163\u014F \u0163\u0125\u0113 \u014B\u0105\u028B\u012F\u011F\u0105\u0163\u012F\u014F\u014B \u0163\u0105\u0157\u011F\u0113\u0163 \u0171\u015F\u012F\u014B\u011F \u0105\u014B \u03C7\u0100\u03C1\u03C1 \u015F\u0163\u0105\u0163\u0113 \u010B\u014F\u014B\u0163\u0105\u012F\u014B\u0113\u0157.\n\n\u015C\u0113\u013A\u0113\u010B\u0163 \u0163\u0125\u0113 '\u016E\u015F\u0113 \u010E\u0177\u014B\u0105\u0271\u012F\u010B \u01A4\u0105\u0157\u0105\u0271\u0113\u0163\u0113\u0157\u015F' \u010B\u0125\u0113\u010B\u0137\u0183\u014F\u03C7 \u0163\u014F \u0113\u03C7\u03C1\u014F\u015F\u0113 \u0105\u013A\u013A \u015F\u012F\u014B\u011F\u013A\u0113 \u028B\u0105\u013A\u0171\u0113 \u0192\u012F\u013A\u0163\u0113\u0157\u015F \u0105\u014B\u018C \u03C1\u0105\u0157\u0105\u0271\u0113\u0163\u0113\u0157\u015F \u0192\u0157\u014F\u0271 \u0163\u0125\u0113 \u010B\u014F\u014B\u0163\u0113\u03C7\u0163 \u0105\u013A\u015F\u014F \u0105\u015F \u016E\u0158\u013B \u03C1\u0105\u0157\u0105\u0271\u0113\u0163\u0113\u0157\u015F. \u0162\u0125\u012F\u015F \u0271\u0105\u0177 \u0183\u0113 \u0157\u0113\u01A3\u0171\u012F\u0157\u0113\u018C, \u0192\u014F\u0157 \u0113\u03C7\u0105\u0271\u03C1\u013A\u0113, \u012F\u0192 \u0163\u0125\u0113 \u014B\u0105\u028B\u012F\u011F\u0105\u0163\u012F\u014F\u014B \u0163\u0105\u0157\u011F\u0113\u0163 \u012F\u015F \u0171\u014B\u0105\u0183\u013A\u0113 \u0163\u014F \u010B\u014F\u014B\u015F\u0171\u0271\u0113 \u0105 \u010B\u014F\u014B\u0163\u0113\u03C7\u0163 \u0192\u0157\u014F\u0271 \u0163\u0125\u0113 \u03C7\u0100\u03C1\u03C1 \u015F\u0163\u0105\u0163\u0113 \u014F\u0157 \u012F\u0192 \u0163\u0125\u0113 \u012F\u014B\u0163\u0113\u014B\u0163 \u014F\u0192 \u0163\u0125\u0113 \u014B\u0105\u028B\u012F\u011F\u0105\u0163\u012F\u014F\u014B \u0163\u0105\u0157\u011F\u0113\u0163 \u0125\u0105\u015F \u0271\u0105\u014B\u018C\u0105\u0163\u014F\u0157\u0177 \u03C1\u0105\u0157\u0105\u0271\u0113\u0163\u0113\u0157\u015F \u0163\u0125\u0105\u0163 \u0271\u0171\u015F\u0163 \u0183\u0113 \u03C1\u0157\u014F\u028B\u012F\u018C\u0113\u018C \u0105\u015F \u016E\u0158\u013B \u03C1\u0105\u0157\u0105\u0271\u0113\u0163\u0113\u0157\u015F.\n\n\u01A4\u013A\u0113\u0105\u015F\u0113 \u014B\u014F\u0163\u0113 \u0163\u0125\u0105\u0163 \u0163\u0125\u0113\u015F\u0113 \u03C1\u0105\u0157\u0105\u0271\u0113\u0163\u0113\u0157\u015F \u0175\u012F\u013A\u013A \u014F\u010B\u010B\u0171\u0157 \u012F\u014B \u0163\u0125\u0113 \u016E\u0158\u013B \u014F\u0192 \u0163\u0125\u0113 \u010B\u0105\u013A\u013A\u0113\u018C \u0105\u03C1\u03C1\u013A\u012F\u010B\u0105\u0163\u012F\u014F\u014B \u0105\u014B\u018C, \u0163\u0125\u0113\u0157\u0113\u0192\u014F\u0157\u0113, \u018C\u0105\u0163\u0105 \u03C1\u0157\u014F\u0163\u0113\u010B\u0163\u012F\u014F\u014B \u0105\u014B\u018C \u03C1\u0157\u012F\u028B\u0105\u010B\u0177 \u0105\u015F\u03C1\u0113\u010B\u0163\u015F \u0125\u0105\u028B\u0113 \u0163\u014F \u0183\u0113 \u010B\u014F\u014B\u015F\u012F\u018C\u0113\u0157\u0113\u018C.]]]
